import './App.css';

import Home from './routes/Home';
import Projects from './routes/Projects';

import {Routes, Route} from 'react-router-dom';
import {Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/projects" element={<Projects />} />
      </Routes>
    </div>
  );
}

export default App;
